    <p>
        The Indian Cricket League (ICL) was founded in 2007, with funding provided by Zee Entertainment Enterprises. The ICL
        was not recognised by the Board of Control for Cricket in India (BCCI) or the International Cricket Council (ICC) and the BCCI
        were not pleased with its committee members joining the ICL executive board. To prevent players from joining the ICL,
        the BCCI increased the prize money in their own domestic tournaments and also imposed lifetime bans on players joining the ICL,
        which was considered a rebel league by the board.
    </p>
    <h5>Foundation</h5>
    <p>
        On 13 September 2007, the BCCI announced the launch of a franchise-based Twenty20 cricket competition called Indian Premier League whose first season was slated to start in April 2008, in a ""high-profile ceremony"" in New Delhi.
        BCCI vice-president Lalit Modi, said to be the mastermind behind the idea of the IPL, spelled out the details of the tournament including i");
