        the prize money, franchise revenue system and squad composition rules. It was also revealed that the IPL would be run by a seven-man governing council composed of former India players
        and BCCI officials and that the top two teams of the IPL would qualify for that year's Champions League Twenty20.
        Modi also clarified that they had been working on the idea for two years and that the IPL was not started as a ""knee-jerk reaction"" to the ICL.[17] The league's format was similar to that of the Premier League of England and the NBA in the United States.
        In order to decide the owners for the new league, an auction was held on 24 January 2008 with the total base prices of the franchises costing around $400 million.[16] At the end of the auction, the winning bidders were announced,
        as well as the cities the teams would be based in: Bangalore, Chennai, Delhi, Hyderabad, Jaipur, Kolkata, Mohali, and Mumbai.
