    </p>
    <h5>Expansion And Termination </h5>
    <p>
        On 21 March 2010, it was announced that two new franchises – Pune Warriors India and Kochi Tuskers Kerala – would join the league before the fourth season in 2011.[20]
        Sahara Adventure Sports Group bought the Pune franchise for $370 million while Rendezvous Sports World bought the Kochi franchise for $333.3 million.[20] However, one year later, on 11 November 2011,
        it was announced that the Kochi Tuskers Kerala side would be terminated following the side breaching the BCCI's terms of conditions.[21]
        Then, on 14 September 2012, following the team not being able to find new owners, the BCCI announced that the 2009 champions, the Deccan Chargers,
